DROP TABLE IF EXISTS ZIPCODE;
 
CREATE TABLE ZIPCODE (
  d_codigo VARCHAR (50)  PRIMARY KEY,
  d_asenta VARCHAR(250) NOT NULL,
  d_tipo_asenta VARCHAR(250) NOT NULL,
  D_mnpio VARCHAR(250) NOT NULL,
  d_estado VARCHAR(250) NOT NULL,
  d_ciudad VARCHAR(20) NOT NULL,
  d_CP VARCHAR(50) NOT NULL,
  c_estado VARCHAR(50) NULL,
  c_oficina VARCHAR(50)  NULL,
  c_CP VARCHAR(50)  NULL,
  c_tipo_asenta VARCHAR(50)  NULL,
  c_mnpio VARCHAR(50) NULL,
  id_asenta_cpcons VARCHAR(50) NULL,
  d_zona VARCHAR(50) NULL,
  cod VARCHAR(50) NULL
);


